@ClientHandling.type: #CLIENT_DEPENDENT
@AbapCatalog.deliveryClass: #APPLICATION_DATA
@AccessControl.authorizationCheck: #NOT_REQUIRED
@EndUserText.label: 'NFe Tax ICMS 10'
define table entity /EXEDMINB/T_NFeTaxICMS10
{
  key Id      : abap.char(44);  // FK para Header (chNFe)
  key ItemId  : abap.int4;      // FK para item (NFeItem)

      orig    : abap.char(1);   // Origem da mercadoria
      CST     : abap.char(2);   // Código da Situação Tributária (10)
      modBC   : abap.char(1);   // Modalidade de determinação da BC ICMS
      vBC     : abap.dec(15,2); // Valor da base de cálculo ICMS
      pICMS   : abap.dec(5,2);  // Alíquota do ICMS (%)
      vICMS   : abap.dec(15,2); // Valor do ICMS
      modBCST : abap.char(1);   // Modalidade da BC do ICMS ST
      vBCST   : abap.dec(15,2); // Valor da base de cálculo ICMS ST
      pICMSST : abap.dec(5,2);  // Alíquota do ICMS ST (%)
      vICMSST : abap.dec(15,2); // Valor do ICMS ST
}
